// src/components/Header.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Header = () => {
  const navigate = useNavigate();

  return (
    <>
        <div><h1 text-3xl font-bold underline>Welcome to the Model Prediction App</h1></div>
        <div>
            <button onClick={() => navigate('/')}>Home</button>
            <button onClick={() => navigate('/iris-model')}>Iris Model</button>
            <button onClick={() => navigate('/result-model')}>Result Model</button>
        </div>
    </>
  );
};

export default Header;
